import React, { useState } from "react";
import {
  Flex,
  Stack,
  Text,
  ActionIcon,
  Slider,
  ColorPicker,
  Avatar,
  Group,
  Divider,
  Accordion,
  rem,
  Checkbox,
} from "@mantine/core";
import {
  IconCircleXFilled,
  IconHome2,
  IconHome,
  IconHomeBolt,
  IconHomeCheck,
  IconHomeDown,
  IconCategory2,
  IconUser,
  IconSearch,
  IconMessageCircle,
  IconShoppingBag,
  IconPhoto,
  IconPrinter,
  IconCameraSelfie,
} from "@tabler/icons-react";
const NavbarItem = () => {
  const [selectedIcon, setSelectedIcon] = useState(null);
  const [selectedHomeIcon, setSelectedHomeIcon] = useState(null);
  const [selectedCatagoryIcon, setSelectedCatagoryIcon] = useState(null);

  const handleIconClick = (index, component) => {
    console.log("Clicked icon :", component);
    setSelectedIcon(index);
  };

  const handleHomeIconClick = (index, component) => {
    console.log("Clicked icon :", component);
    setSelectedHomeIcon(index);
  };

  const handleCatagoryIconClick = (index, component) => {
    console.log("Clicked icon :", component);
    setSelectedCatagoryIcon(index);
  };

  const icons = [
    { name: "IconHome2", component: <IconHome2 /> },
    { name: "IconMessageCircle", component: <IconMessageCircle /> },
    { name: "IconSearch", component: <IconSearch /> },
    { name: "IconShoppingBag", component: <IconShoppingBag /> },
    { name: "IconUser", component: <IconUser /> },
  ];

  const homeicons = [
    { name: "IconHome2", component: <IconHome2 /> },
    { name: "IconHome", component: <IconHome /> },
    { name: "IconHomeBolt", component: <IconHomeBolt /> },
    { name: "IconHomeCheck", component: <IconHomeCheck /> },
    { name: "IconHomeDown", component: <IconHomeDown /> },
  ];

  const catagoryicons = [
    { name: "IconCategory2", component: <IconHome2 /> },
    { name: "IconHome", component: <IconHome /> },
    { name: "IconHomeBolt", component: <IconHomeBolt /> },
    { name: "IconHomeCheck", component: <IconHomeCheck /> },
    { name: "IconHomeDown", component: <IconHomeDown /> },
  ];
  return (
    <Stack bg="gray.3" radious="xs">
      <Stack bg="indigo.2">
        <Flex
          mih={50}
          bg="white"
          m="xs"
          ml="xs"
          mr="xs"
          gap="md"
          justify="center"
          align="center"
          direction="row"
          wrap="wrap"
          style={{ border: "1px solid #1b1c1b", borderRadius: "25px" }}
        >
          {icons.map((icon, index) => (
            <ActionIcon
              radius="xl"
              key={index}
              variant={selectedIcon === index ? "outline" : "default"}
              aria-label={`Icon ${icon.component}`}
              onClick={() => handleIconClick(index, icon)}
            >
              {/* <Avatar>{icon.component}</Avatar> */}
              {icon.component}
            </ActionIcon>
          ))}
        </Flex>
      </Stack>
      {/* <Divider /> */}

      <Accordion ml="xs" mr="xs" variant="contained">
        <Accordion.Item value="photos">
          <Accordion.Control>Navbar Items</Accordion.Control>
          <Accordion.Panel>
            <Stack>
              <Group gap="xs">
                <Checkbox ml="xs" />
                <IconHome2 />
                <Text>Home Icon</Text>
              </Group>
              <Flex
                mih={50}
                bg="white"
                ml="xs"
                mr="xs"
                gap="md"
                justify="center"
                align="center"
                direction="row"
                wrap="wrap"
                style={{ border: "1px solid #1b1c1b", borderRadius: "5px" }}
              >
                {homeicons.map((homeicon, index) => (
            <ActionIcon
              radius="md"
              key={index}
              variant={selectedHomeIcon === index ? "outline" : "default"}
              aria-label={`Icon ${homeicon.component}`}
              onClick={() => handleHomeIconClick(index, homeicon)}
            >
              {homeicon.component}
            </ActionIcon>
          ))}
              </Flex>
            </Stack>

            <Stack mt="xs">
              <Group gap="xs">
                <Checkbox ml="xs" />
                <IconCategory2/>
                <Text>Category Icon</Text>
              </Group>
              <Flex
                mih={50}
                bg="white"
                ml="xs"
                mr="xs"
                gap="md"
                justify="center"
                align="center"
                direction="row"
                wrap="wrap"
                style={{ border: "1px solid #1b1c1b", borderRadius: "5px" }}
              ></Flex>
            </Stack>

            <Stack mt="xs">
              <Group gap="xs">
                <Checkbox ml="xs" />
                <IconHome2 />
                <Text>Home Icon</Text>
              </Group>
              <Flex
                mih={50}
                bg="white"
                ml="xs"
                mr="xs"
                gap="md"
                justify="center"
                align="center"
                direction="row"
                wrap="wrap"
                style={{ border: "1px solid #1b1c1b", borderRadius: "5px" }}
              ></Flex>
            </Stack>

            <Stack mt="xs">
              <Group gap="xs">
                <Checkbox ml="xs" />
                <IconHome2 />
                <Text>Home Icon</Text>
              </Group>
              <Flex
                mih={50}
                bg="white"
                ml="xs"
                mr="xs"
                gap="md"
                justify="center"
                align="center"
                direction="row"
                wrap="wrap"
                style={{ border: "1px solid #1b1c1b", borderRadius: "5px" }}
              ></Flex>
            </Stack>

            <Stack mt="xs">
              <Group gap="xs">
                <Checkbox ml="xs" />
                <IconHome2 />
                <Text>Home Icon</Text>
              </Group>
              <Flex
                mih={50}
                bg="white"
                ml="xs"
                mr="xs"
                gap="md"
                justify="center"
                align="center"
                direction="row"
                wrap="wrap"
                style={{ border: "1px solid #1b1c1b", borderRadius: "5px" }}
              ></Flex>
            </Stack>
            
          </Accordion.Panel>
        </Accordion.Item>

        <Accordion.Item value="print">
          <Accordion.Control
            icon={
              <IconPrinter
                style={{
                  color: "var(--mantine-color-blue-filled",
                  width: rem(20),
                  height: rem(20),
                }}
              />
            }
          >
            Print photos
          </Accordion.Control>
          <Accordion.Panel>Content</Accordion.Panel>
        </Accordion.Item>

        <Accordion.Item value="camera">
          <Accordion.Control
            icon={
              <IconCameraSelfie
                style={{
                  color: "var(--mantine-color-teal-filled)",
                  width: rem(20),
                  height: rem(20),
                }}
              />
            }
          >
            Camera settings
          </Accordion.Control>
          <Accordion.Panel>Content</Accordion.Panel>
        </Accordion.Item>
      </Accordion>
    </Stack>
  );
};

export default NavbarItem;
